import * as React from "react";
import gql from "graphql-tag";

// Style
import './GutterMenu.styl'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faAnchor,
    faLock
} from '@fortawesome/free-solid-svg-icons'


type GutterMenuProps = {
    userCookie
    toggleGutter
    toggleMenu
    toggleGutterLoader
}

//
// Function
//

const GutterMenu: React.FunctionComponent<GutterMenuProps> = (props:any) => {

    //
    // Use Effect
    //

    React.useEffect(() => {
        console.log(props)
    });

    // Return
    return (
        <>
            <div className="menu-primary">
                <div className="menu-logo"><FontAwesomeIcon icon={faAnchor}/></div>
                <div className="menu-header">
                    { props.userCookie.avatar && <div className="header-avatar" style={{'backgroundImage':'url(https://images.unsplash.com/photo-1485893086445-ed75865251e0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1000&q=80)',"backgroundSize":"cover","backgroundPosition":"center center"}}></div>}
                    { !props.userCookie.avatar && <div className="header-avatar">{props.userCookie.fullName && props.userCookie.fullName[0]}</div>}
                    <p>Ahoy</p>
                    <h1>{props.userCookie.fullName && props.userCookie.fullName}</h1>
                </div>
                <div className="menu-navigation">
                <div className="navigation-group">
                    <div className="group-label">Decks</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('company-decks','two-active')}>All Decks</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('create-deck','two-active')}>Create Deck</div>
                </div>
                <div className="navigation-group">
                    <div className="group-label">Invitations</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('invite-user','two-active')}>Invite User</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('user-invites','two-active')}>View Invitations</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('create-invite-link','two-active')}>Generate Invite Link</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('invite-links','two-active')}>View Invite Links</div>
                </div>
                <div className="navigation-group">
                    <div className="group-label">Admin</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('invite-new-user','two-active')}>View Users</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('user-settings','two-active')}>User Settings</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('company-settings','two-active')}>Company Settings</div>
                    <div className="group-link" onClick={(event) => props.toggleGutter('payment-settings','two-active')}>Payment Settings</div>
                </div>
                <div className="navigation-logout-button">Logout<div className="button-icon"><FontAwesomeIcon icon={faLock}/></div></div>
                </div>
                <div className="menu-footer"><div className="footer-icon"><FontAwesomeIcon icon={faAnchor}/></div> Copyright Seedeck 2020</div>
            </div>
        </>
    );
};

export default GutterMenu
